<?php

require_once 'RomanNumeral.php';

class RomanNumeralTest extends PHPUnit_Framework_TestCase
{
    /**
     * @dataProvider romanNumeralProvider
     * @group standard
     */
    public function testToRoman($number, $expected)
    {
        $this->assertSame($expected, 
            (new RomanNumeral())->toRoman($number));
    }

    public function romanNumeralProvider()
    {
        return [
            [1, 'I'],
            [2, 'II'],
            [3, 'III'],
            [4, 'IV'],
            [5, 'V'],
            [6, 'VI'],
            [7, 'VII'],
            [8, 'VIII'],
            [9, 'IX'],
            [10, 'X'],
            [11, 'XI'],
            [14, 'XIV'],
            [15, 'XV'],
            [18, 'XVIII'],
            [19, 'XIX'],
            [20, 'XX'],
            [34, 'XXXIV'],
            [39, 'XXXIX'],
            [40, 'XL'],
            [45, 'XLV'],
            [49, 'XLIX'],
            [50, 'L'],
            [60, 'LX'],
            [64, 'LXIV'],
            [90, 'XC'],
            [91, 'XCI'],
            [93, 'XCIII'],
            [98, 'XCVIII'],
            [99, 'XCIX'],
            [100, 'C'],
            [107, 'CVII'],
            [141, 'CXLI'],
            [194, 'CXCIV'],
            [199, 'CXCIX'],
            [400, 'CD'],
            [444, 'CDXLIV'],
            [498, 'CDXCVIII'],
            [499, 'CDXCIX'],
            [500, 'D'],
            [566, 'DLXVI'],
            [600, 'DC'],
            [877, 'DCCCLXXVII'],
            [900, 'CM'],
            [938, 'CMXXXVIII'],
            [950, 'CML'],
            [999, 'CMXCIX'],
            [1000, 'M'],
            [1001, 'MI'],
            [1409, 'MCDIX'],
            [3000, 'MMM'],
            [4999, 'MMMMCMXCIX'],
        ];
    }

    /**
     * @dataProvider largeRomanNumeralProvider
     * @group large
     */
    public function testToRomanLargeNumbers($number, $expected)
    {
        $this->assertSame($expected, 
            (new RomanNumeral())->toRoman($number));
    }

    public function largeRomanNumeralProvider()
    {
        return [
            [5000, 'MMMMM'],
            [9999, 'MMMMMMMMMCMXCIX'],
            [49999, 'MMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMCMXCIX'],
            [400000049, ''],
            //[400000000000, ''],
        ];
    }

}
